import { Component } from '@angular/core';

@Component({
  selector: 'app-helo',
  templateUrl: './helo.component.html',
  styleUrls: ['./helo.component.css']
})
export class HeloComponent {
  myName: string = ""
  showName() {
    this.myName = "tien"
  }
}
